import React from 'react';
import logo from '../img/clapperboard.png';
import { Link } from 'react-router-dom';
import { MyRoutes } from './Router';

const Header = () => {
  return (
    <header className="header">
        <div className="header-title">
            <img className="logo" src={logo}></img>
            <h2 className="title">Cinemaniac</h2>
        </div>
        <div className="header-links">
          <Link className="links" to={MyRoutes.HOME}>Blockbusters</Link>
          <Link className="links" to={`${MyRoutes.SELECTION}/marvel`}>Marvel's</Link>
          <Link className="links" to={MyRoutes.PIXAR}>Pixar</Link>
        </div>
    </header>
  )
}

export default Header;
